"use es6";

import React from "react";
import stars from "../images/stars.png";
import stripes from "../images/stripes.png";
import * as d3 from "d3";

const HomePage = () => {
  const canvasstyle = {
    width: "fit-content",
    height: "fit-content",
  };

  const starsstyle = {
    backgroundColor: "#000077",
    width: "fit-content",
    height: "fit-content",
  };

  const stripesstyle = {
    backgroundColor: "#770000",
    width: "fit-content",
    height: "fit-content",
  };

  var svgContainer = d3
    .select("#canvas")
    .append("svg")
    .attr("align", "center")
    .attr("width", 1105)
    .attr("height", 700);

  var sym = d3.symbol().type(d3.symbolStar).size(1000);

  svgContainer
    .append("path")
    .attr("d", sym)
    .attr("fill", "#00ffff")
    .attr("x", 223)
    .attr("y", 120);

  return (
    <>
      <div>
        <h1>HOME</h1>
        <div id="canvas" style={canvasstyle}></div>
        <div style={starsstyle}>
          <img src={stars} alt={"stars"} />
        </div>
        <div style={stripesstyle}>
          <img src={stripes} alt={"stripes"} />
        </div>
      </div>
    </>
  );
};

export default HomePage;
